import { useState, useEffect } from "react";
import thumbnail from '../../assets/placeholder.jpg';
import { useParams } from "react-router-dom";
import { Helmet } from "react-helmet";
import { NavLink } from "react-router-dom";
import Navbar from "../Navbar";
import Side from "../Side";
import Sidebar from "../Sidebar";
import ChannelLayer from "./ChannelLayer";
import ChannelButtons from "./ChannelButtons";
import LoadingBar from "react-top-loading-bar";

function ChannelAbout({ userInfo }){
    const [videos, setVideos] = useState([]);
    const [isLoading, setIsLoading] = useState(true);
    const [delayedLoading, setDelayedLoading] = useState(false);
    const [totalview, setTotalview] = useState([]);
    const { channelId } = useParams();


    useEffect(() => {
       
        const videos_data = () => {
            fetch('http://localhost:8000/api/user_videos', {
                method: 'GET',
                credentials: 'include',
            })
            .then(response => {
                if(response.status == 200){
                    return response.json();
                } else {
                    throw new Error('failed to fetch user videos..');
                }
            })
            .then(data => {
                setVideos(data.videos);
                setTotalview(data.videos_count);
                setIsLoading(false);
                setTimeout(() => {
                    setDelayedLoading(true);
                }, 100);
            })
            .catch(error => {
                console.error('Error fetching user info:', error);
            });
        }
        videos_data();
    }, []);


    return (
        <>
            <Helmet>
                <title>{`${userInfo.channeluser} - YouTube`}</title>
            </Helmet>

            <LoadingBar
                color="#ff0000" // Customize the color (e.g., red)
                height={1.5}       // Customize the height (4 pixels)
                progress={isLoading ? 30 : 100} // Set progress based on loading state
            />

            <Navbar userInfo={userInfo} />
            <div className="main">
                <Side />
                <Sidebar />
                <div className="main-scroll">
                    <div className="channelcon">
                        <div className="banner" style={{backgroundImage: `url(${userInfo.channelbanner})`}}>
                            
                        </div>
                        <div className="channel-outer">
                            <ChannelLayer userInfo={userInfo} channelId={channelId} totalview={totalview} />
                            <ChannelButtons userInfo={userInfo} channelId={channelId} />
                            <div className="channel-inner">
                                <div className="aboutdesc">
                                    <div className="left">
                                        <div className="descript">
                                            <label>Description</label>
                                            <p></p>
                                                <p>{userInfo.description}</p>
                                            <p></p>
                                        </div>
                                    </div>
                                    <div className="right">
                                        <div className="stats">
                                            <label>Stats</label>
                                            <div className="line"></div>
                                            <span>Joined {userInfo.joined}</span>
                                            <div className="line"></div>
                                            <span>{useinf} views</span>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>





            
        </>
    )
}
export default ChannelAbout;
